import React from "react";
import './App.css';
import logo from './logo.svg';
import { NavLink } from "react-router-dom";
const Home=()=>{
    return(
        <h1>Homepage</h1>
    )
}

const Login=()=>{
  const [email,setEmail]=React.useState('');
  const [password,setPassword]=React.useState('');

    return(
    <div className="App">
    <div className='inputform'>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h4>Welcome!</h4>
      </header>
      <div>
      <lable for="email" className="formtext">Email &nbsp;</lable>
      <input className="email" type="text" placeholder='Enter the email' required onChange={(e)=>{setEmail(e.target.value)}}></input>
      </div>
      <br></br>
      <div>
      <lable for="password" className="formtext">Password &nbsp;</lable>
      <input className="password" type="password" placeholder='Enter the Password' required onChange={(e)=>{setPassword(e.target.value)}}></input>
      </div>
      <div className='submission'>
      <button type='submit'>Login</button>
      </div>
      <p>Don't have a account <a className='link'><NavLink>Create account!</NavLink></a></p>
      </div>
      </div>
    );
}

export {Login,Home};
